import React, { useState, useEffect } from 'react';
import './App.css';
import Box from '@material-ui/core/Box'


function Home() {
  return (
    <div>
      <Box component="span" color="orange" m={1}>
        <h1>Home Page</h1>
      </Box>
    </div>
    
  );
}

export default Home;
